contracts/StorageFactory.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./SimpleStorage.sol";

contract StorageFactory is SimpleStorage { //"is contract_X" makes the new contract inherite all the functions and objects in contract_x

    SimpleStorage[] public simpleStorageArray;

    function createSimpleStorageContract() public {
        SimpleStorage simpleStorage = new SimpleStorage();
        simpleStorageArray.push(simpleStorage);
    }

    function sfStore(uint256 _simpleStorageIndex, uint256 _simpleStorageNumber) public {
        //Para interagir com outro contrato é necessário Address e ABI
        SimpleStorage(address(simpleStorageArray[_simpleStorageIndex])).store(_simpleStorageNumber);
        //same as this
        //SimpleStorage simpleStorage = SimpleStorage(address(simpleStorageArray[_simpleStorageIndex]));
        //simpleStorage.store(_simpleStorageNumber);
        
    }

    function sfGet(uint256 _simpleStorageIndex) public view returns(uint256) {
        return SimpleStorage(address(simpleStorageArray[_simpleStorageIndex])).retrieve();
        //same as this
        //SimpleStorage simpleStorage = SimpleStorage(address(simpleStorageArray[_simpleStorageIndex]));
        //return simpleStorage.retrieve();
    }    
}

contracts/SimpleStorage.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract SimpleStorage{

    //this number will get initialized to 0!
    uint256  favoriteNumber;

    //bool favoriteBool = false;
    //string favoriteString = "String";
    //int256 favoriteInt = -5;
    //address favoriteAdress = ;
    //bytes32 favoriteBytes = "cat";

    struct People {
        uint256 favoriteNumber;
        string name;
    }

    People public person = People({favoriteNumber: 2, name: "Patrick"});

    function store(uint256 _favoriteNumber) public {
        favoriteNumber = _favoriteNumber;
    }

    function retrieve() public view returns(uint256){
        return favoriteNumber;
    }

    People[] public people;

    function addPerson(string memory _name, uint256 _favoriteNumber) public returns (People[] memory){
        //people.push(People({favoriteNumber: _favoriteNumber, name: _name})); one way of populating the array
        
        //if we know the order of the array, we can pass the variables straight to it
        people.push(People(_favoriteNumber, _name));
        nametoFavoriteNumber[_name] = _favoriteNumber;

        return people;
        
    }

    mapping(string => uint256) public nametoFavoriteNumber;

}

